{"translationLines":[{"lineNumber":173241,"originalJapaneseLine":"「逃げ出した敵の姿はないよ」","translatedEnglishLine":"\"There's no sign of the fleeing enemy.\""},{"lineNumber":173242,"originalJapaneseLine":"「これでしばらくは落ち着けるだろう」","translatedEnglishLine":"\"With this, we should be able to settle down for a while.\""},{"lineNumber":173243,"originalJapaneseLine":"「皆さん、ご無事だったんですね！」","translatedEnglishLine":"\"Everyone, you're safe!\""},{"lineNumber":173244,"originalJapaneseLine":"「うおぉんおんおんおん！","translatedEnglishLine":"\"Waaah, waaah, waaah!\""},{"lineNumber":173245,"originalJapaneseLine":"　香様〜！　よくぞご無事でおられた〜！」","translatedEnglishLine":"\"Lady Kaoru~! I'm so glad you're safe~!\""},{"lineNumber":173246,"originalJapaneseLine":"「うおんおんおん！」","translatedEnglishLine":"\"Waaah, waaah!\""},{"lineNumber":173247,"originalJapaneseLine":"「ほんに良かった〜！」","translatedEnglishLine":"\"Truly, I'm so glad~!\""},{"lineNumber":173248,"originalJapaneseLine":"「うおおおおおおおお！×３」","translatedEnglishLine":"\"Wooooaaaahhh! Wooooaaaahhh! Wooooaaaahhh!\""},{"lineNumber":173249,"originalJapaneseLine":"「もう、３Ｇ。","translatedEnglishLine":"\"Geez, 3G already.\""},{"lineNumber":173250,"originalJapaneseLine":"　そんなに泣かないで……」","translatedEnglishLine":"\"Don’t cry so much...\""},{"lineNumber":173251,"originalJapaneseLine":"「儂らもおりますぞ。ﾇﾇﾇ」","translatedEnglishLine":"\"We're here too. Nunu.\""},{"lineNumber":173252,"originalJapaneseLine":"「うむ！　これもALICE様のお導き！","translatedEnglishLine":"\"Indeed! This is also by Lady ALICE’s guidance!\""},{"lineNumber":173253,"originalJapaneseLine":"　間に合ったことに感謝を！」","translatedEnglishLine":"\"We are grateful to have made it in time!\""},{"lineNumber":173254,"originalJapaneseLine":"「メガッスさん！","translatedEnglishLine":"\"Megass-san!\""},{"lineNumber":173255,"originalJapaneseLine":"　ロードリングさんも！」","translatedEnglishLine":"\"And Lord Ring too!\""},{"lineNumber":173256,"originalJapaneseLine":"「他のメンバーも皆無事よ。","translatedEnglishLine":"\"All the other members are safe too.\""},{"lineNumber":173257,"originalJapaneseLine":"　だから……」","translatedEnglishLine":"\"So...\""},{"lineNumber":173258,"originalJapaneseLine":"「むぎゅう……","translatedEnglishLine":"\"Mugyu...\""},{"lineNumber":173259,"originalJapaneseLine":"　だから離してぇ、マリアぁ……」","translatedEnglishLine":"\"So let me go, Maria...\""},{"lineNumber":173260,"originalJapaneseLine":"「駄目、離さない！","translatedEnglishLine":"\"No, I won’t let you go!\""},{"lineNumber":173261,"originalJapaneseLine":"　もう、もう、心配かけて！」","translatedEnglishLine":"\"Geez, geez, don’t make me worry!\""},{"lineNumber":173262,"originalJapaneseLine":"「なんにしても、これで全員集合だすな！","translatedEnglishLine":"\"Anyway, now we’re all gathered!\""},{"lineNumber":173263,"originalJapaneseLine":"　おら、とっても嬉しいだす！","translatedEnglishLine":"\"I’m really happy about this!\""},{"lineNumber":173264,"originalJapaneseLine":"　わーい！」","translatedEnglishLine":"\"Yay!\""},{"lineNumber":173265,"originalJapaneseLine":"「わーいわーい！」","translatedEnglishLine":"\"Yay, yay!\""},{"lineNumber":173266,"originalJapaneseLine":"「本当に良かったですねー」","translatedEnglishLine":"\"It really was a relief, wasn’t it?\""},{"lineNumber":173267,"originalJapaneseLine":"「しかし、お前ら死んだのかとばっかり……」","translatedEnglishLine":"\"But we all thought you guys were dead…\""},{"lineNumber":173268,"originalJapaneseLine":"「ああ、実際あの嵐は危なかったぜ……","translatedEnglishLine":"\"Yeah, that storm was really dangerous…\""},{"lineNumber":173269,"originalJapaneseLine":"　サンライズ号とは離れるわ、","translatedEnglishLine":"\"We got separated from the Sunrise, \"},{"}
