{"lineNumber":173270,"originalJapaneseLine":"　船は半壊するわでもう駄目かと……","translatedEnglishLine":"the ship was half-destroyed, we thought it was over...\""},{"lineNumber":173271,"originalJapaneseLine":"「運よく島に辿り着いてな……","translatedEnglishLine":"\"Luckily, we reached the island...\""},{"lineNumber":173272,"originalJapaneseLine":"　そこで船を修理してたってわけだ","translatedEnglishLine":"\"And we were repairing the ship there.\""},{"lineNumber":173273,"originalJapaneseLine":"「だが、どうやってここまで……","translatedEnglishLine":"\"But how did you get here...\""},{"lineNumber":173274,"originalJapaneseLine":"「それは……","translatedEnglishLine":"\"That is...\""},{"lineNumber":173275,"originalJapaneseLine":"　あんたのおかげだろ？　暗黒魔女さん」","translatedEnglishLine":"\"Thanks to you, right? Dark Witch.\""},{"lineNumber":173276,"originalJapaneseLine":"「上手く行くかは賭けだったがな」","translatedEnglishLine":"\"It was a gamble whether it would work or not.\""},{"lineNumber":173277,"originalJapaneseLine":"「む、なんかしてやがったな」","translatedEnglishLine":"\"Hmm, she did something, huh.\""},{"lineNumber":173278,"originalJapaneseLine":"「大したことじゃない」","translatedEnglishLine":"\"It's nothing special.\""},{"lineNumber":173279,"originalJapaneseLine":"「なんとなぁくこちらに仲間がいる気がするなぁ、","translatedEnglishLine":"\"I just somehow had a feeling there were comrades here,\""},{"lineNumber":173280,"originalJapaneseLine":"　と人間だけが感じるフェロモンを、","translatedEnglishLine":"\"a pheromone that only humans can sense,\""},{"lineNumber":173281,"originalJapaneseLine":"　魔物界に来てからずっと魔法で放っていただけだ」","translatedEnglishLine":"\"I had been releasing it through magic ever since we came to the monster world.\""},{"lineNumber":173282,"originalJapaneseLine":"「サンセット号とはぐれてから","translatedEnglishLine":"\"After losing the Sunset ship,"},{"lineNumber":173283,"originalJapaneseLine":"　即席で作った魔法だったが、","translatedEnglishLine":"\"I made this magic on the spot, but,"},{"lineNumber":173284,"originalJapaneseLine":"　運良く上手くいったようだな」","translatedEnglishLine":"\"luckily it seems to have worked well.\""},{"lineNumber":173285,"originalJapaneseLine":"「まったく。","translatedEnglishLine":"\"Good grief.\""},{"lineNumber":173286,"originalJapaneseLine":"　そういうことは前もって言っておけ」","translatedEnglishLine":"\"You should have told us that beforehand.\""},{"lineNumber":173287,"originalJapaneseLine":"皆が互いに肩を抱き、手を取り合い、","translatedEnglishLine":"They all hug each other's shoulders and hold hands,"},{"lineNumber":173288,"originalJapaneseLine":"無事の再会を喜び合う。","translatedEnglishLine":"celebrating their safe reunion."},{"lineNumber":173289,"originalJapaneseLine":"「ふう……しかし、なんだな。","translatedEnglishLine":"\"Phew... but still,\""},{"lineNumber":173290,"originalJapaneseLine":"　遅れちまって悪かったな、大将」","translatedEnglishLine":"\"Sorry for being late, boss.\""},{"lineNumber":173291,"originalJapaneseLine":"「ふん、今回のお前は遅刻してばっかりだな」","translatedEnglishLine":"\"Hmph, you’ve been late all the time this round.\""},{"lineNumber":173292,"originalJapaneseLine":"「カッカッカッ、言葉もねぇぜ！」","translatedEnglishLine":"\"Ha ha ha, I'm speechless!\""},{"lineNumber":173293,"originalJapaneseLine":"「だが……","translatedEnglishLine":"\"But...\""},{"lineNumber":173294,"originalJapaneseLine":"「おおっ、これなら……","translatedEnglishLine":"\"Oh, if it's like this...\""},{"lineNumber":173295,"originalJapaneseLine":"　行けるかもしれんな……！」","translatedEnglishLine":"\"We might be able to make it...!\""},{"lineNumber":173296,"originalJapaneseLine":"「よーし、全員揃ったところで","translatedEnglishLine":"\"Alright, now that everyone's gathered,"},{"lineNumber":173297,"originalJapaneseLine":"　俺様の話を聞け！」","translatedEnglishLine":"listen to what I have to say!\""},{"lineNumber":173298,"originalJapaneseLine":"「俺達は先ほどまで","translatedEnglishLine":"\"We were just now,"},{"lineNumber":173299,"originalJapaneseLine":"　ケイブリスと戦っていたところだ！」","translatedEnglishLine":"fighting the Kayblis!\""},{"lineNumber":173300,"originalJapaneseLine":"「まあ……","translatedEnglishLine":"\"Well...\""}]}

